import React from 'react';
import "../hojas-de-estilo/GaleriaFlotante.css";

function GaleriaFlotante(){
  return(
    <div className='flotante'>
      <div>
        <div className='img_principal'>
          <img src={imgppal} alt="imagen_principal" />
        </div>
        <div className='miniaturas'>
          <div><img src={min1} alt="miniatura1" /></div>
          <div><img src={min2} alt="miniatura2" /></div>
          <div><img src={min3} alt="miniatura3" /></div>
          <div><img src={min4} alt="miniatura4" /></div>
        </div>
      </div>
    </div>
  );
}

export default GaleriaFlotante;
